import React from 'react'
import { Button } from 'grommet';

const Name = () => {
    const [count, setCount] = React.useState(0)
    return (
        <Box>
            <Text>0</Text>
            <Button label="+1" onClick={() => setCount(count+1)}></Button>
        </Box>
    )
}
export default Name
